<h2 style="margin: 0">2</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 - arginine conjugate , a novel HIV - 1 Tat antagonist : synthesis and anti-HIV activities . HIV - 1 transactivating protein Tat is essential for virus replication and progression of HIV disease . HIV - 1 Tat stimulates transactivation by binding to HIV - 1 transactivator responsive element ( TAR ) RNA , and while secreted extracellularly , it acts as an immunosuppressor , an activator of quiescent T-cells for productive HIV - 1 infection , and by binding to CXC chemokine receptor type 4 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) as a chemokine analogue . Here we present a novel HIV - 1 Tat antagonist , a neomycin B-hexaarginine conjugate ( NeoR ) , which inhibits Tat transactivation and antagonizes Tat extracellular activities , such as increased viral production , induction of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P61073
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 expression , suppression of CD3 - activated proliferation of lymphocytes , and upregulation of the CD8 receptor . Moreover , Tat inhibits binding of fluoresceine isothiocyanate ( FITC ) - labeled NeoR to human peripheral blood mononuclear cells ( PBMC ) , indicating that Tat and NeoR bind to the same cellular target . This is further substantiated by the finding that NeoR competes with the binding of monoclonal Abs to 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P61073

 . Furthermore , NeoR suppresses HIV - 1 binding to cells . Importantly , NeoR accumulates in the cell nuclei and inhibits the replication of M - and T-tropic HIV - 1 laboratory isolates ( EC ( 50 ) = 0.8- 5.3 microM ) . A putative model structure for the TAR-NeoR complex , which complies with available experimental data , is presented . We conclude that NeoR is a multitarget HIV - 1 inhibitor ; the structure , and molecular modeling and dynamics , suggest its binding to TAR RNA . NeoR inhibits HIV - 1 binding to cells , partially by blocking the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 HIV - 1 coreceptor , and it antagonizes Tat functions . NeoR is therefore an attractive lead compound , capable of interfering with different stages of HIV infection and AIDS pathogenesis .</div>

 ) . The aim of the present study was to determine the intracellular signal pathways involved in genistein-stimulated duodenal HCO ( 3 ) ( - ) secretion . Murine duodenal mucosal HCO ( 3 ) ( - ) secretion was examined in vitro in Ussing chambers by the pH-stat technique . The results showed that neither DB02527 - dependent signal pathway inhibitors MDL - 12330A and KT - 5720 , nor cGMP signal pathway inhibitors NS2028 and KT5823 , nor calcium signal pathway inhibitors verapamil and W - 13 , altered genistein-stimulated duodenal HCO ( 3 ) ( - ) secretion . In calcium-free solution , genistein-stimulated duodenal HCO ( 3 ) ( - ) secretion was not altered either . Vanadate , an inhibitor of protein tyrosine phosphatase , only partially inhibited genistein-stimulated duodenal HCO ( 3 ) ( - ) secretion . However , both wortmannin and LY294002 , two structurally and mechanistically distinct phosphatidylinositol 3 - kinase ( PI3K ) inhibitors , markedly inhibited genistein-stimulated duodenal HCO ( 3 ) ( - ) secretion .

 increased duodenal mucosal PI3K activity and induced the phosphorylation of Akt , a signaling molecule downstream of PI3K , which was again inhibited by wortmannin .

<div class="entities" style="line-height: 2.5; direction: ltr">Design and synthesis of 3,5- disubstituted -1,2 , 4 - oxadiazoles as potent inhibitors of phosphodiesterase 4b2 . A series of 3,5- disubstituted -1,2 , 4 - oxadiazoles has been prepared and evaluated for phosphodiesterase inhibition ( PDE 4B2 ) . Among the prepared 3,5- disubstituted -1,2 , 4 - oxadiazoles , compound 9a is the most potent inhibitor ( PDE 4B2 IC ( 50 ) = 5.28 μm ) . Structure-activity relationship studies of 3,5- disubstituted -1,2 , 4 - oxadiazoles revealed that substituents 3 - cyclopentyloxy - 4 - methoxyphenyl group at 3 - position and cyclic ring bearing heteroatoms at 5 - position are important for activity . Molecular modeling study of the 3,5- disubstituted -1,2 , 4 - oxadiazoles with

<h2 style="margin: 0">15</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">

 - A ( FC ) , a compound produced by the fungus Fusicoccum amygdali Del . In plant cells , FC complexes with 14-3- 3 proteins to activate H + pumping across the plasma membrane . It has long been thought that FC acts on higher plants only ; here , we show that exposing frog embryos to FC during early development specifically results in randomization of the asymmetry of the left-right ( LR ) axis ( heterotaxia ) . Biochemical and molecular-genetic evidence is presented that 14-3- 3 - family proteins are an obligate component of Xenopus FC receptors and that perturbation of 14-3- 3 protein function results in heterotaxia . The subcellular localization of 14-3- 3 mRNAs and proteins reveals novel cytoplasmic destinations , and a left-right asymmetry at the first cell division . Using gain-of-function and loss-of-function experiments , we show that

 protein is likely to be an endogenous and extremely early aspect of LR patterning . These data highlight a striking conservation of signaling pathways across kingdoms , suggest common mechanisms of polarity establishment between C . elegans and vertebrate embryos , and uncover a novel entry point into the pathway of left-right asymmetry determination .</div>
